import React, { useState, useEffect } from 'react';

export default function DatabaseView() {
  const [activeTab, setActiveTab] = useState('ucc');
  const [uccRegistrations, setUccRegistrations] = useState([]);
  const [orders, setOrders] = useState([]);

  useEffect(() => {
    // Fetch UCC registrations
    fetch('http://localhost:4000/api/database/ucc-registrations')
      .then(res => res.json())
      .then(data => {
        if (data.success) {
          setUccRegistrations(data.data);
        }
      })
      .catch(err => console.error('Error fetching UCC registrations:', err));

    // Fetch orders
    fetch('http://localhost:4000/api/database/orders')
      .then(res => res.json())
      .then(data => {
        if (data.success) {
          setOrders(data.data);
        }
      })
      .catch(err => console.error('Error fetching orders:', err));
  }, []);

  return (
    <div className="container mt-4">
      <h2 className="mb-4">Database Records</h2>

      <ul className="nav nav-tabs mb-4">
        <li className="nav-item">
          <button
            className={`nav-link ${activeTab === 'ucc' ? 'active' : ''}`}
            onClick={() => setActiveTab('ucc')}
          >
            UCC Registrations
          </button>
        </li>
        <li className="nav-item">
          <button
            className={`nav-link ${activeTab === 'orders' ? 'active' : ''}`}
            onClick={() => setActiveTab('orders')}
          >
            Orders
          </button>
        </li>
      </ul>

      {activeTab === 'ucc' && (
        <div className="table-responsive">
          <table className="table table-striped">
            <thead>
              <tr>
                <th>Client Code</th>
                <th>Name</th>
                <th>Email</th>
                <th>Registration Date</th>
                <th>Status</th>
              </tr>
            </thead>
            <tbody>
              {uccRegistrations.map((reg) => (
                <tr key={reg.clientCode}>
                  <td>{reg.clientCode}</td>
                  <td>{`${reg.firstName} ${reg.lastName}`}</td>
                  <td>{reg.email}</td>
                  <td>{new Date(reg.registrationDate).toLocaleDateString()}</td>
                  <td>{reg.responseData?.status || 'Completed'}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      )}

      {activeTab === 'orders' && (
        <div className="table-responsive">
          <table className="table table-striped">
            <thead>
              <tr>
                <th>Order Ref</th>
                <th>Client Code</th>
                <th>Scheme Code</th>
                <th>Amount</th>
                <th>Order Date</th>
                <th>Status</th>
              </tr>
            </thead>
            <tbody>
              {orders.map((order) => (
                <tr key={order.orderRefNumber}>
                  <td>{order.orderRefNumber}</td>
                  <td>{order.clientCode}</td>
                  <td>{order.schemeCode}</td>
                  <td>₹{order.amount.toLocaleString()}</td>
                  <td>{new Date(order.orderDate).toLocaleDateString()}</td>
                  <td>{order.status}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      )}
    </div>
  );
}
